import React from 'react';
import { useSelector, useDispatch } from 'react-redux';
import { Notebook } from '../../types';

const NotebookList: React.FC = () => {
  const notebooks = useSelector((state: any) => state.notebooks.items);
  
  return (
    <div className="p-4">
      <div className="flex justify-between items-center mb-4">
        <h2 className="text-xl font-bold">Notebooks</h2>
        <button className="text-sm bg-blue-500 px-2 py-1 rounded">
          + New
        </button>
      </div>
      
      <div className="space-y-2">
        {notebooks.map((notebook: Notebook) => (
          <div 
            key={notebook.id}
            className="flex items-center p-2 hover:bg-gray-700 rounded cursor-pointer"
          >
            <span className="material-icons mr-2">notebook</span>
            {notebook.title}
          </div>
        ))}
      </div>
    </div>
  );
};

export default NotebookList;
